import React from 'react';
import WeatherData from '../Data/WeatherData.json';
import SingleWeatherComp from '../WeatherComponents/SingleWeatherComponent.js';
const weatherList = (props) => {
    return (
        <div id="weather_list">
      {props.results.map((weatherDetails, index)=>{
          return <div>
              <SingleWeatherComp temperatur={weatherDetails[index].title} nummer={weatherDetails[index].location_type}/>
              <hr></hr>
          </div>;
      })}
        </div>
    )
};

export default weatherList;
